import Card from './Card';
import CardList from './CardList';
import { useState } from 'react';

function App() {

  const [professores, setProfessores] = useState([

    { name: 'Gabriel Militello', bio: 'Doutorando e Mestre em Educação: Currículo', ies: 'PUC-SP' },
    { name: 'Jonas Sousa', bio: 'Cursando pedagogia', ies: 'Mackenzie' }

  ]);



  return (
    <CardList>
      <Card
        name='Gabriel Militello'
        bio='Doutorando e Mestre em Educação: Currículo'
        ies='PUC-SP'
      />

      <Card
        name='Jonas Sousa'
        bio='Cursando pedagogia'
        ies='Mackenzie'
      />
    </CardList>
  )
}

export default App;
